import React from 'react';
import Card from './CharacterCard';

const StudentContainer = (props) => {
  const allStudentsCards = [...props.allStudents].map(student=><Card handleToggle={props.handleToggle} studentData={student} />)
  return (
    <div id="character-list">
    {allStudentsCards}
    </div>
  )
}

export default StudentContainer;
